//Dieses Skript steuert die Annotaionsanzeige und enthält sämtliche Informationen zu den gezeichneten Fassaden der Kreuter'schen Karten.

using System.Collections;
using System.Collections.Generic;
using UnityEngine;
using TMPro;

public class VisitorInteraction : MonoBehaviour
{
    string pfarrei;
    string kreuter;
    string keussen;
    string typ;
    string nr;
    public string info;
	public string pfarrei_info;
	public string kreuter_info;
	public string keussen_info;
	public string typ_info;
    public string nr_info;

    public TMP_Text Pfarrei;
    public TMP_Text Straße;
    public TMP_Text Hausnummer;
    public TMP_Text Kreuter_Info;
    public TMP_Text Keussen_Info;
    public TMP_Text Typ;

    [SerializeField] private string selectableTag = "Selectable";

    // Start is called before the first frame update
    void Start()
    {
        
    }

    // Update is called once per frame
    void Update()
    {
        InteractRaycast();
        Pfarrei.SetText(pfarrei_info);
        Straße.SetText(info);
        Hausnummer.SetText(nr_info);
        Kreuter_Info.SetText(kreuter_info);
        Keussen_Info.SetText(keussen_info);
        Typ.SetText(typ_info);
        
    }

    void InteractRaycast()
    {
        Vector3 playerPosition = transform.position;
        Vector3 fowardDirection = transform.forward;

        Ray interactionRay = new Ray(playerPosition, fowardDirection);
        RaycastHit interactionRayHit;
        float interactionRayLength = 100.0f;

        Vector3 interactionRayEndpoint = fowardDirection * interactionRayLength;
        Debug.DrawLine(playerPosition, interactionRayEndpoint);

        Physics.Raycast(interactionRay, out interactionRayHit, interactionRayLength);

        bool hitFound = Physics.Raycast(interactionRay, out interactionRayHit, interactionRayLength);
        if (hitFound)
        {
            var selection = interactionRayHit.transform;
            if (selection.CompareTag(selectableTag))
            { GameObject hitGameObject = interactionRayHit.transform.gameObject;
            string hitFeedback = hitGameObject.name + " was hit at " + interactionRayHit.point;
            Debug.Log(hitFeedback);
            Funktion(hitGameObject.name);}
            else {
                            string nothingHitFeedback = "Nothing was hit.";
            Debug.Log(nothingHitFeedback);
            info = "-";
	        pfarrei_info = "-";
	        kreuter_info = "-";
	        keussen_info = "-";
	        typ_info = "-";
            nr_info = "-";
            }
           
        }
        else
        {
            string nothingHitFeedback = "Nothing was hit.";
            Debug.Log(nothingHitFeedback);
            info = "-";
	        pfarrei_info = "-";
	        kreuter_info = "-";
	        keussen_info = "-";
	        typ_info = "-";
            nr_info = "-";
        }
    }

